<strong>اسم المنتج:</strong> زبيري متُوسع مبطن.

<strong>لون المنتج:</strong> بني.

<strong>العلامة التجارية:</strong> صناعة خراز القعلة.

<strong>تفاصيل إضافية:</strong> بطانة، يتميّز زبيري حساوي متُوسع عين بصلابته وقوّته، بالإضافة إلى تاريخه القديم وأصالته المُحكمة.

&nbsp;

&nbsp;

&nbsp;

&nbsp;

&nbsp;

<strong>اسم المنتج:</strong> زبيري حساوي متوسع عين.

<strong>لون المنتج:</strong> بني.

<strong>تفاصيل إضافية: </strong>بدون بطانة، يتميّز الزبيري الحساوي "متُوسع" عين بصلابته وقوّته، بالإضافة إلى تاريخه القديم وأصالته المُحكمة.

&nbsp;

&nbsp;

اسم المنتج: سبحة حجر عين النمر

عدد الخرز : 33 خرزه.

اللون: بني.

تفاصيل إضافية: سبحة حجر عين النمر قطعة فنية، مكملة للبس الرجل العربي الأصيل، طراز يقوم بإضفاء ذوق رفيع لمن يقتنيها والمسابيح متوارثة منذ القدم، تراث عميق من أنواع الأحجار الكريمة، يتم تجهيزها يدوياً بخيوط عالية، وحياكة احترافية.

&nbsp;

